import './App.css';
import React from 'react';
import { useNavigate } from 'react-router-dom';

export function App() {
  const navigate = useNavigate();
  const fun=() => {

    if(localStorage.getItem('token') !== null)
    {
      navigate('/sign');
    }
  };
  fun();
  return (
    <div className="App">
      <h1></h1>
    </div>
  );
}

export default App;
